import "./HomePage.css";
// import React from "react";
import Button from "@mui/material/Button";
import React, { useState, useEffect } from "react";
import bballCourtImage from "../images/basketball-court.jpg";
import toiletImage from "../images/toilet.jpg";
import gazeboImage from "../images/gazebo.jpg";

function HomePage() {
	const [image, setImage] = useState("image1.jpg");
	return (
		<div className="homepage_container">
			<div className="img_container">
				<img className="homepage_img" src={image} alt="Image" />
			</div>
			<div className="image_button_container">
				<li>
					<Button variant="contained" onClick={() => setImage(bballCourtImage)}>
						Basketball Court Installation
					</Button>
				</li>
				<li>
					<Button variant="contained" onClick={() => setImage(toiletImage)}>
						Toilet Replacement
					</Button>
				</li>
				<li>
					<Button variant="contained" onClick={() => setImage(gazeboImage)}>
						Gazebo Installation
					</Button>
				</li>
			</div>
		</div>
	);
}

export default HomePage;
